"original": |2-
     Note: In many cases, the Client supplies only those Input Pages that
     need to be printed in the Document data, and the "page-ranges" Job
     Template attribute is not used.  However, Clients that submit
     already-generated Document data (either static content from some web
     site or previously submitted content the End User wishes to reprint)
     can use this attribute to print just a subset of the pages contained
     in the Document.  In this case, if a "page-ranges" value of 'n-m' is
     specified, the first page to be printed will be page n.  All
     subsequent pages of the Document will be printed through and
     including page m.
"fixed": |-
  Note: In many cases, the Client supplies only those Input Pages that need to be printed in the Document data, and the "page-ranges" Job Template attribute is not used.  However, Clients that submit already-generated Document data (either static content from some web site or previously submitted content the End User wishes to reprint) can use this attribute to print just a subset of the pages contained in the Document.  In this case, if a "page-ranges" value of 'n-m' is specified, the first page to be printed will be page n.  All subsequent pages of the Document will be printed through and including page m.
"ko": |-
  참고: 대부분의 경우 클라이언트는 문서 데이터에 인쇄해야 하는 입력 페이지만 제공하며 "페이지 범위" 작업 템플릿 속성은 사용되지 않습니다. 그러나 이미 생성된 문서 데이터(일부 웹 사이트의 정적 콘텐츠 또는 최종 사용자가 다시 인쇄하기를 원하는 이전에 제출한 콘텐츠)를 제출하는 클라이언트는 이 속성을 사용하여 문서에 포함된 페이지의 하위 집합만 인쇄할 수 있습니다. 이 경우 '페이지 범위' 값 'n-m'이 지정되면 인쇄할 첫 번째 페이지는 n 페이지가 됩니다. 문서의 모든 후속 페이지는 m 페이지를 포함하여 인쇄됩니다.
